        <script>
        $(document).ready(function() {
            configuration = {
                width: 484,
                height: 314,
                server: true,
                script: 'node.js'
            };
            commands = {
                colorful: function(args, cbk) {

            $('.consolas').animate({'opacity':1}, 1111);
        })
